### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. Probability and Conditional Probability
- **Concepts**: Understanding basic probability, conditional probability, and how to use them in real-world scenarios.
- **Equations**:
  - Basic Probability: \( P(A) = \frac{\text{Number of favorable outcomes}}{\text{Total number of outcomes}} \)
  - Conditional Probability: \( P(A|B) = \frac{P(A \cap B)}{P(B)} \)

#### 2. Demand-Response Curve
- **Concepts**: Understanding non-linear demand-response curves and how to estimate demand at different price points.
- **Equations**:
  - Linear Demand Function: \( D(p) = a - bp \)
  - Non-linear Demand Function: More complex equations may be used, but the linear form is often a simplification.

#### 3. Linear Programming
- **Concepts**: Formulating and solving linear programming problems, understanding primal and dual formulations, binding and non-binding constraints.
- **Equations**:
  - Primal Formulation:
    \[
    \text{Maximize } c^T x
    \]
    \[
    \text{Subject to } Ax \leq b, x \geq 0
    \]
  - Dual Formulation:
    \[
    \text{Minimize } b^T y
    \]
    \[
    \text{Subject to } A^T y \geq c, y \geq 0
    \]

#### 4. Logistic Regression and Confusion Matrix
- **Concepts**: Understanding logistic regression, confusion matrices, and performance metrics like precision, recall, sensitivity, specificity, and accuracy.
- **Equations**:
  - Precision: \( \frac{TP}{TP + FP} \)
  - Recall (Sensitivity): \( \frac{TP}{TP + FN} \)
  - Specificity: \( \frac{TN}{TN + FP} \)
  - Accuracy: \( \frac{TP + TN}{TP + TN + FP + FN} \)

#### 5. Regression Analysis
- **Concepts**: Understanding regression output, coefficients, standard error, t-statistics, R-squared, adjusted R-squared, and significance.
- **Equations**:
  - Simple Linear Regression: \( y = \beta_0 + \beta_1 x + \epsilon \)
  - Multiple Linear Regression: \( y = \beta_0 + \beta_1 x_1 + \beta_2 x_2 + \ldots + \beta_n x_n + \epsilon \)
  - R-squared: \( R^2 = 1 - \frac{SS_{res}}{SS_{tot}} \)
  - Adjusted R-squared: \( \bar{R}^2 = 1 - \frac{SS_{res}/(n-p)}{SS_{tot}/(n-1)} \)

